isAnimating = false
isPainting = false
pageSelection = 0
size = 0
colorSelection = false
inputMode = false

clearPage = ()=>{
    currentPage().coordinates = []
    currentPage().filteredCoordinates = []
    filterAndDraw()
}

playIt = ()=>{
setTimeout(()=> play(0), 500)
setTimeout(()=> play(1), 8000)
setTimeout(()=> play(2), 16000)
setTimeout(()=> {colorSelection='red';play(3)}, 24000)
}

simulate = ()=>{
    clearCanvas()
    animatedDots.forEach( dot => {

        dot.currentx += dot.velx*0.1
        dot.currenty += dot.vely*0.1

        var reacedx = (dot.destinationx - dot.currentx)*0.2

        var reacedy = (dot.destinationy - dot.currenty)*0.2

        dot.velx = reacedx
        dot.vely = reacedy
        
        ctx.fillStyle = dot.color
        drawAt(dot.currentx, dot.currenty)
    })
    if(isAnimating)
        requestAnimationFrame(simulate)
}



play = (pageIdx=pageSelection)=> {
    animatedDots.forEach( (dot,idx) => {
        var coord = pages[pageIdx].filteredCoordinates[idx]

        // Gå igenom alla dots! Det finns flera än de flesta coordinates.


        dot.velx = 0
        dot.vely = 0
        dot.startx = dot.currentx 
        dot.starty = dot.currenty
        
        var o2 = outside()

        if(coord){
            dot.destinationx = coord.x
            dot.destinationy = coord.y
            dot.isOutside = false
        }
        else if(!dot.isOutside){
            dot.destinationx = o2.x
            dot.destinationy = o2.y
            dot.isOutside = true
        }
        

        dot.velx = dot.destinationx - dot.startx
        dot.vely = dot.destinationy - dot.starty
        
        dot.color = colorSelection || randomHsl()
    })

    if(!isAnimating){
        isAnimating = true
        requestAnimationFrame(simulate)
    }
}


drawAt = (x,y) =>{
//     console.log(x,y)
    ctx.beginPath()
    ctx.arc(x*size, y*size, 5, 0, 2 * Math.PI)
    ctx.fill()
//     ctx.fillRect(x*size,y*size,10,10);
}

clearCanvas = () => {
    ctx.clearRect(0, 0, cnvs.width, cnvs.height);
}

roundCoordinates = (precision = 3) => 
pages.forEach(page => {
        page.coordinates.forEach(
            c=>{c.x=parseFloat(c.x.toFixed(precision)); c.y=parseFloat(c.y.toFixed(precision));}
        )
        page.filteredCoordinates.forEach(
            c=>{c.x=parseFloat(c.x.toFixed(precision)); c.y=parseFloat(c.y.toFixed(precision));}
        )

})

filterAndDraw = (newPage = pageSelection)=> {
    
        
    isAnimating = false
    pageSelection = newPage
    filterOut()
    clearCanvas()
    ctx.fillStyle = "#00F";
    currentPage().filteredCoordinates.forEach( c =>drawAt(c.x,c.y,3,3))
    ctx.fillStyle = "#FF0000";
}

filterOut = ()=>
currentPage().
coordinates.forEach( candidate =>{
    if(currentPage().filteredCoordinates.
       find( c2 => (candidate.x-c2.x)**2 + (candidate.y-c2.y)**2 < 0.0001)
    ) {return}

    currentPage().filteredCoordinates.push(candidate)
})

randomHsl = () => `hsla(${Math.random() * 360}, 100%, 50%, 1)`

pages.push({coordinates:[], filteredCoordinates:[]})

outside = ()=>{
    var top = Math.random() > 0.5

    var outcoord = ()=> Math.random() > 0.5 ? 1.1 : -0.1
    
    if(top){
        return {
            x:outcoord(),
            y:Math.random()
        }
    }
    return {
            y:outcoord(),
            x:Math.random()
        }
}
